import React, { Component } from "react";

class CartItem extends Component {
  render() {
    return (
      <div className="cart-item">
        <div className="cart-item-image-wrapper">
          <img
            className="cart-item-image"
            alt="cartitem"
            src={this.props.store.products[0].image}
          />
        </div>
        <div className="cart-item-info-wrapper">
          <span className="cross-mark">x</span>
          <div className="cart-item-del-wrapper" />
          <div className="cart-item-info">
            <div className="item-info">
              <div className="item-name">name</div>
              <div className="size-style">XL | Branco</div>
              <div className="item-qty">Quantity : 1</div>
            </div>
            <div className="item-price">
              <span>$</span>14.54
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default CartItem;
